import React, { Component } from 'react';
import './custom.css';
import Acer from '../images/acer.jpg'

class Custom extends Component {
    render() {
        return (
            <div className="ItemList">
                <img src={Acer} alt="Laptop" />
                <div className="container">
                    <h4 className="linkButton">><b>{this.props.title}</b></h4>
                    <p>text</p> 
                    <ul>
                        <li>Location:</li>
                        <li>Condition:</li>
                        <li>Mobile:></li>
                        <li>Price:</li>
                    </ul>
                </div>
            </div>
        );
    }
}

export default Custom;
